import React, { Component } from "react";
import "./styles.scss";
import { connect } from "react-redux";
import * as actions from "./../../../../Actions/index";

class Home extends Component {
  render() {
    return (
      <div className="container" id="home">
        <table className="table table-striped table-hover">
          <thead>
            <tr>
              <th>STT</th>
              <th>Image</th>
              <th>Name Product</th>
              <th>Status</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody className="list-products ">
            <tr>
              <td>1</td>
              <td>
                <img
                  src="https://static.gigabyte.com/StaticFile/Image/Global/bca9c8f7bd6517cefc26df54eb3ba2dc/Product/26279/webp/400"
                  alt=""
                />
              </td>
              <td className="fw-bold">AORUS</td>
              <td className="">
                <span className="label-status bg-success rounded text-white p-1">
                  Stocking
                </span>
              </td>
              <td>
                <button className="btn shadow-none me-3 bg-danger text-white">
                  Delete
                </button>
                <button className="btn shadow-none bg-warning text-white">
                  Update
                </button>
              </td>
            </tr>
          </tbody>
        </table>
      </div>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    products: state.products,
  };
};

const mapDispatchToProps = (dispatch, props) => {
  return {
    onGetProducts: () => {
      dispatch(actions.acFetchProductsRequest());
    },
  };
};

export default connect(mapStateToProps, mapDispatchToProps)(Home);
